import XCTest

final class BuddyStrings: XCTestCase {
  func test_buddyStrings() throws {
    let solution = Solution_859()
    XCTAssertFalse(solution.buddyStrings("abc", "cbad"))
    XCTAssertFalse(solution.buddyStrings("abdc", "cbad"))
    XCTAssertTrue(solution.buddyStrings("abcd", "abdc"))
    XCTAssertTrue(solution.buddyStrings("abcd", "cbad"))
    XCTAssertTrue(solution.buddyStrings("ab", "ba"))
    XCTAssertFalse(solution.buddyStrings("ab", "ab"))
    XCTAssertTrue(solution.buddyStrings("aa", "aa"))
    XCTAssertFalse(
      solution.buddyStrings(
        "",
        ""))
  }
}
